" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Vistonuridine: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F7976689\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Antidote",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F7976696\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Fluorouracil overdose (unlabeled use):",
"     </b>",
"     Oral: 10 g every 6 hours for 20 doses beginning as soon as possible (8 hours to 4 days) after fluorouracil overdose (von Borstel, 2009)",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F7976697\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block accres drugH1Div\" id=\"F11234389\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Prescribing and Access Restrictions",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Uridine triacetate (formerly called vistonuridine) is supplied for emergency use under a single-patient Investigational New Drug (IND) provision. Procurement information is available from Wellstat Therapeutics at 1-443-831-5626.",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F7976698\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Administer orally (tablets); begin as soon as possible following of fluorouracil overdose (within 8-96 hours).",
"    </p>",
"   </div>",
"   <div class=\"block usu drugH1Div\" id=\"F7976690\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use - Unlabeled",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Antidote for fluorouracil overdose or overexposure",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13300196\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     None known.",
"    </p>",
"   </div>",
"   <div class=\"block dri drugH1Div\" id=\"F8018477\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Drug Interactions",
"    </span>",
"    <br/>",
"    <br/>",
"    <div class=\"lexi\" id=\"lexiInteractAddInfo\">",
"     (For additional information:",
"     <a class=\"dip\" href=\"./drug-interaction\" target=\"_blank\">",
"      Launch Lexi-Interact&trade; Drug Interactions Program",
"     </a>",
"     )",
"    </div>",
"    <div class=\"lexi\" id=\"lexiInteractImgB\">",
"     <img border=\"0\" height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"    </div>",
"    <div class=\"clear\">",
"    </div>",
"    <p style=\"text-indent:0em;display:inline\">",
"     There are no known significant interactions.",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F7976700\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     CBC with differential; gastrointestinal toxicity",
"    </p>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F7976691\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Uridine triacetate (formerly called vistonuridine), a prodrug of uridine, is converted to uridine triphosphate (UTP) which competes with FUTP for incorporation into RNA, thereby preventing cell death and dose-limiting fluorouracil toxicity.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F7976693\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Metabolism: Deacetylated (by esterases) to uridine",
"    </p>",
"   </div>",
"  </div>",
"  <div id=\"topicAgreement\">",
"   Use of UpToDate is subject to the",
"   <a class=\"licenseLink\" href=\"./license\" id=\"sla_in_page\" target=\"_blank\">",
"    Subscription and License Agreement",
"   </a>",
"   .",
"  </div>",
