"      <i>",
"       J Clin Oncol",
"      </i>",
"      , 1997, 15(4):1511-7.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?43/25/44433/abstract-text/9193347/pubmed\" id=\"9193347\" target=\"_blank\">",
"        9193347",
