"    <li>",
"     <div class=\"reference\">",
"      von Borstel R, O&rsquo;Neil J, and Bamat M, &ldquo;Vistonuridine: An Orally Administered, Life-Saving Antidote for 5-Fluorouracil (5FU) Overdose,&rdquo;",
"      <i>",
