"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      von Borstel R, O&rsquo;Neil JD, Saydoff JA, et al, &ldquo;Uridine Triacetate for Lethal 5-FU Toxicity Due to Dihydropyrimidine Dehydrogenase (DPD) Deficiency,&rdquo;",
"      <i>",
