"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?43/25/44437/abstract/10\">",
"      Kitahata MM, Koepsell TD, Deyo RA, et al. Physicians' experience with the acquired immunodeficiency syndrome as a factor in patients' survival. N Engl J Med 1996; 334:701.",
"     </a>",
