var title_f43_25_44444="Risk stratification KD";
var content_f43_25_44444=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F62986&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F62986&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for risk stratification of myocardial infarction in the long-term follow-up of children with Kawasaki disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Risk level",
"       </td>",
"       <td class=\"subtitle1\">",
"        Medical therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Physical activity",
"       </td>",
"       <td class=\"subtitle1\">",
"        Follow-up schedule",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        I",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        No CA changes at any stage of illness",
"       </td>",
"       <td>",
"        None after first 6 - 8 weeks",
"       </td>",
"       <td>",
"        No restrictions after first 6 - 8 weeks",
"       </td>",
"       <td>",
"        CV risk assessment, counseling at 5-year intervals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        II",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Transient CA ectasia (resolves within 8 weeks)",
"       </td>",
"       <td>",
"        None after first 6 - 8 weeks",
"       </td>",
"       <td>",
"        No restrictions after first 6 - 8 weeks",
"       </td>",
"       <td>",
"        CV risk assessment, counseling at 3 to 5-year intervals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        III",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1 small-medium CA aneurysm in 1 major coronary artery",
"       </td>",
"       <td>",
"        Low dose aspirin (3 - 5 mg/kg per day) until documented regression of aneurysm",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         <strong>",
"          Age &lt;11 years",
"         </strong>",
"         :",
"        </p>",
"        <p>",
"         No restrictions after first 6 - 8 weeks",
"        </p>",
"        <p>",
"         <strong>",
"          Age 11 - 20 years",
"         </strong>",
"         :",
"        </p>",
"        <p>",
"         Restriction guided by results of cardiac testing",
"        </p>",
"       </td>",
"       <td>",
"        Annual cardiology follow-up; invasive testing at discretion of cardiologist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;1 large or giant CA aneurysm, or multiple or complex aneurysms in same CA without obstruction",
"       </td>",
"       <td>",
"        Long-term antiplatelet therapy AND warfarin or low-molecular weightheparin for those with giant aneurysms",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Contact and high-risk sports should be avoided because of the risk of bleeding",
"        </p>",
"        <p>",
"         Other restrictions guided by results of cardiac testing",
"        </p>",
"       </td>",
"       <td>",
"        Cardiology follow-up twice per year; invasive testing at discretion of cardiologist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        V",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CA obstruction",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Long-term low-dose aspirin",
"        </p>",
"        <p>",
"         Warfarin or low-molecular weight heparin if giant aneurysm persists",
"        </p>",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         Contact and high-risk sports should be avoided because of the risk of bleeding",
"        </p>",
"        <p>",
"         Other restrictions guided by results of cardiac testing",
"        </p>",
"       </td>",
"       <td>",
"        Cardiology follow-up twice per year; invasive testing at discretion of cardiologist",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CA: coronary artery; CV: cardiovascular.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Newburger, JW, Takahashi, M, Gerber, MA, et al. Diagnosis, treatment, and ong-term management of Kawasaki disease: a statement for health professionals from the Committee on Rheumatic Fever, Endocarditis, and Kawasaki Disease, Council on Cardiovascular Disease in the Young, American Heart Association. Pediatrics 2004; 114:1708.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
